"          <br>",
"           (D) Beckmann CRB, Ling FW, Smith RP, et al. Obstetrics and Gynecology, 5th Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 2006.",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
