var title_f22_53_23387="ACG guidelines liver disease during pregnancy";
var content_f22_53_23387=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F72172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F72172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American College of Gastroenterology Guidelines: Liver disease in the pregnant patient",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Use of gestational age of the pregnancy is the best guide to the differential diagnosis of liver disease in the pregnant woman",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperemesis gravidarum should be considered in the differential diagnosis of abnormal liver tests presenting in the first trimester",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cholestasis of pregnancy is common, and should be considered in the differential diagnosis of abnormal liver tests presenting initially in the second trimester. Affected pregnancies are at increased risk for prematurity and stillbirth, and early delivery should be considered when possible",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HELLP (hemolysis, elevated liver tests, low platelets) syndrome and acute fatty liver of pregnancy should be considered in the differential diagnosis of abnormal liver tests in the second half of pregnancy, usually in the third trimester",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with acute fatty liver of pregnancy have true hepatic dysfunction, and may, or may not, have signs of pre-eclampsia and HELLP syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider viral or drug-induced hepatitis, gallstone disease, or malignancy in the differential diagnosis of abnormal liver tests in any of the trimesters of pregnancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic hepatitis B or C poses a risk of transmission to the offspring",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Riely CA. Liver disease in the pregnant patient. Am J Gastroenterol 1999; 94:1728.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
