" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Type of fat intake affects cholesterol concentrations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        Diet enriched with",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        Saturated fatty acids, g per",
"100g fat",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        Trans fatty acids, g per 100g",
"fat",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"3\" rowspan=\"1\">",
"        Compared with butter-enriched diet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        LDL-C, percent",
"       </td>",
"       <td class=\"subtitle2\">",
"        HDL-C, percent",
"       </td>",
"       <td class=\"subtitle2\">",
"        TC:HDL-C, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soybean oil",
"       </td>",
"       <td>",
"        25.0",
"       </td>",
"       <td>",
"        &lt;0.5",
"       </td>",
"       <td>",
"        -12",
"       </td>",
"       <td>",
"        -3",
"       </td>",
"       <td>",
"        -6",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Semiliquid margarine",
"       </td>",
"       <td>",
"        27.0",
"       </td>",
"       <td>",
"        &lt;0.5",
"       </td>",
"       <td>",
"        -11",
"       </td>",
"       <td>",
"        -4",
"       </td>",
"       <td>",
"        -5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft margarine",
"       </td>",
"       <td>",
"        25.2",
"       </td>",
"       <td>",
"        7.4",
"       </td>",
"       <td>",
"        -9",
"       </td>",
"       <td>",
"        -4",
"       </td>",
"       <td>",
"        -2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shortening",
"       </td>",
"       <td>",
"        29.3",
"       </td>",
"       <td>",
"        9.9",
"       </td>",
"       <td>",
"        -7",
"       </td>",
"       <td>",
"        -4",
"       </td>",
"       <td>",
"        -1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stick margarine",
"       </td>",
"       <td>",
"        27.0",
"       </td>",
"       <td>",
"        20.1",
"       </td>",
"       <td>",
"        -5",
"       </td>",
"       <td>",
"        -6",
"       </td>",
"       <td>",
"        +4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Butter",
"       </td>",
"       <td>",
"        61.7",
"       </td>",
"       <td>",
"        1.5",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     In an outpatient feeding study, compared with a butter-enriched diet, diets relatively higher in trans fat resulted in smaller reductions in LDL-cholesterol and larger reductions in HDL-cholesterol (HDL-C). The stick margarine diet, highest in trans fatty acids, resulted in a total cholesterol:HDL cholesterol ratio (TC:HDL-C) that was 4 percent higher than the high saturated fat diet. The diets with the most favorable lipid profiles were the soybean and liquid margarine diets, characterized by low amounts of both saturated and trans fatty acids.",
"    </div>",
"    <div class=\"reference\">",
